import React from "react";
import ReactDOM from "react-dom";
// import App from "./App";


ReactDOM.render(
    <>
<div className="cards">
    <div className="card">
     <img src="https://talenthouse-res.cloudinary.com/image/upload/c_limit,f_auto,fl_progressive,h_1280,w_1280/v1542781501/user-936977/submissions/xlo46stvzbjboqp4lwsi.jpg" alt="myPic" className="card_image"/>

    <div className="card_info">
      <span className="card_category">A Netflix Original Series </span>
       <h3 className="card_title>">Mirzapur</h3>
         <a href="https://www.netflix.com/search/Mirzapur+%282018%29" target="_blank">
          <button>Watch Now</button>
         </a>
     </div>
    </div>
</div>
    </>,
    document.getElementById("root")
);
